import React, { Component } from "react";
import { Button, Form, FormGroup, Input, Label } from "bootstrap";

class FormR extends Component {
  render() {
    return (
      <div>
        <h1>Voting Registration Form</h1>
        <Form>
         <label >
             Name
             <input type="text" />
         </label>
        </Form>
      </div>
    );
  }
}

export default FormR;
